import React from 'react';
import Slide from '../components/News-Carousel/News_Home'; 
/* import Carousel from "../components/News-Carousel/News_Home"; */
import SimpleImageSlider from "react-simple-image-slider";
import background2 from './nkyv2xbkkbl51.png';

const images = [
  { url: {background2} },
  { url: {background2} },
  { url: {background2} },
];
  
const Home = () => {
  return (
    <div id='content'>
      <div id='title'>
        <h1>Top News Articles</h1>
      </div>
     
      <div id='imageSlider'>
        <SimpleImageSlider
          width={896}
          height={504}
          images={images}
        />
      </div>
    
    </div>
  );
};
  
export default Home;
